    "Advanced Composite Thrust Chambers for the Altair Lunar Lander Project",nt"tracking_summary":
    {ntt"total": 3,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T05:55:03.901082",nt"name": "advanced-composite-thrust-chambers-for-the-altair-lunar-lander-project",nt"isopen":
    true,nt"url": null,nt"notes": "Radiation-cooled, bipropellant thrusters
    are being considered for the Ascent Module main engine of the Altair Lunar Lander.
     Currently, iridium-lined rhenium combustion chambers are the state-of-the-art
    for radiatively cooled thrusters.  To increase the performance of radiation-cooled
    engines, improved chamber materials are being developed that will allow higher operating
    temperatures, better resistance to oxidation, and reduce mass.  In an effort to
    increase performance, hafnium oxide thermal barrier coatings and improved iridium
    liners have been developed, and hot-fire tests of rhenium chambers with these improvements
    have shown higher operating temperatures, i.e., &gt;200&lt;SUP&gt;o&lt;/SUP&gt;C
    increase, are possible.  To reduce engine mass, recent efforts have focused on the
    development of carbon-carbon composites.  Replacement of a rhenium structural wall
    with carbon-carbon could result in a mass savings of &gt;600&#37;.  During this
    effort, an innovative composite thrust chamber will be developed that will incorporate
    advanced hafnium oxide and iridium liner techniques as well as replacing the expensive,
    high density rhenium with a low mass carbon-carbon composite.  As a result of this
    investigation, an advanced composite thrust chamber with improved performance capability
    and reduced mass will be produced.  During Phase II, the fabrication methods will
    be optimized and a full-size Ascent Module chamber will be produced and hot-fire
    tested.",nt"license_title": "U.S. Government Work",nt"extras": [{ntt"key":
